import React from "react";
import {NavLink} from "react-router-dom";


const Home = () =>{
    return(
        <>

        <div className="container-fluid header">
            <div className="row">
                <div className="col-10 mx-auto">
                    <div className="col-md-6 pt-5  order-2 order-lg-1">
                        <h1 className="head1">Grow Your Business with <strong className="brand_name">digtan digital</strong></h1>
                        <h5 className="my-3">We are the team of talented developer making websites</h5>
                        <div className="mt-4">
                            <NavLink to="/services" className="btn-get-started">Get Started</NavLink>
                        </div>
                    </div>
                    <div className="col-lg-6 order-1 order-lg-2 header_img">
                        <img src="https://source.unsplash.com/user/jackie/500x400" className="img-fluid animated"/>
                    </div>

                </div>
            </div>
        </div>
        </>
    );
}
export default Home;
